import React from "react";


function Servicesec (){
    
    var quotea = $(".quotea");
    var quoteIndex = -1;

function showNextQuote() {
    ++quoteIndex;
    quotea.eq(quoteIndex % 6)
        .fadeIn(2000)
        .delay(1000)
        .fadeOut(2000, showNextQuote);
}
showNextQuote();





    return(
        <div class="servicesec">
        <p id="servicePar">Services</p>
        <p style={{color:"#e19404",marginTop:"-2%"}}>Image Editing Service</p>
        <hr  id="border10"/>
    
    
       <div id="text-changes-slider" style={{posititon: "relative"}}>
    
       <p class="quotea" style={{marginTop:"-4%"}}><p style={{fontSize:"46px",color:"#e4801c"}}>PHOTO</p>
        <p   id="testret-ret">RETOUCH</p>
        </p>
    
        <p class="quotea" style={{marginTop:"-4%"}}><p style={{fontSize:"46px",color:"#e4801c"}}>BACKGROUND</p>
        <p  id="testret">REMOVAL</p>
        </p>
    
    
        <p class="quotea" style={{marginTop:"-4%"}}><p style={{fontSize:"46px",color:"#e4801c"}}>IMAGE</p>
        <p   id="testret-re">MASKING</p>
        </p>
    
        <p class="quotea" style={{marginTop:"-4%"}}><p style={{fontSize:"46px",color:"#e4801c"}}>GHOST</p>
        <p   id="testret-re">MANNEQUIN</p>
        </p>
    
        <p class="quotea" style={{marginTop:"-4%"}}><p style={{fontSize:"46px",color:"#e4801c"}}>PHOTO</p>
        <p   id="testret-re">RECOLOR</p>
        </p>
    
        <p class="quotea" style={{marginTop:"-4%"}}><p style={{fontSize:"46px",color:"#e4801c"}}>SHADOW</p>
        <p   id="testret-re">CREATION</p>
        </p>
    
    
      </div> 
    </div>
    
    );
}

export default Servicesec;
